uid: microsoft.quantum.logical.notequall
name: NotEqualL
type: function
namespace: microsoft.quantum.logical
summary: Yalnızca iki giriş eşitse true değerini döndürür.
remarks: >-
  Aşağıdakiler eşdeğerdir:


  ```Q#

  let cond = a != b;

  let cond = NotEqualL(a, b);

  ```
syntax: 'function NotEqualL (a : BigInt, b : BigInt) : Bool'
input:
  content: '(a : BigInt, b : BigInt)'
  types:
  - name: a
    summary: Karşılaştırılacak ilk değer.
    isPrimitive: true
    uid: BigInt
  - name: b
    summary: Karşılaştırılacak ikinci değer.
    isPrimitive: true
    uid: BigInt
output:
  content: Bool
  types:
  - summary: '`true` ve yalnızca `a` değerine eşit değilse `b` .'
    isPrimitive: true
    uid: Bool
